groups = [smiley,people,animals_and_nature,foods_and_drinks,activity,travel_and_places,objects,symbols,flags]
group_dict = {
    smiley: "smiley",
    people: "people",
    animals_and_nature: "animals_and_nature",
    foods_and_drinks: "foods_and_drinks",
    activity: "activity",
    travel_and_places: "travel_and_places",
    objects: "objects",
    symbols: "symbols",
    flags: "flags"
}

PROJECT_ROOT = os.path.dirname(os.path.dirname(os.path.dirname(os.path.abspath(__file__))))

output_file = os.path.join(PROJECT_ROOT, "data", "emojipedia", "emojis_with_subgroups.csv")

# Parse the HTML content
with open(output_file, "w", newline="", encoding="utf-8") as csvfile:
        fieldnames = ["Group","Subgroup", "Emoji", "Title", "DescribedBy", "URL"]
        writer = csv.DictWriter(csvfile, fieldnames=fieldnames)

        # Write the header
        writer.writeheader()
        for group in groups:
            soup = BeautifulSoup(group, "html.parser")
            group_name = group_dict[group]
            
            # Find all subgroups by their wrapper divs
            subgroups = soup.find_all("div", class_="mb-4 scroll-mt-[140px] md:scroll-mt-[180px]")

            # Create a data structure to store results
            emoji_data = []

            # Loop through each subgroup to extract details
            for subgroup in subgroups:
                # Extract the subgroup title (e.g., "Smiling & Affectionate")
                subgroup_title = subgroup.find("h2", class_="text-left mb-3 heading-2xl-mobile md:heading-xl").text.strip()

                # Extract all emojis within this subgroup
                emojis = subgroup.find_all("a", class_="Link_link-wrapper__C33u_ Emoji_emoji__6sYSR __variable_c30de8")

                for emoji in emojis:
                    # Extract emoji character
                    emoji_char = emoji.text.strip()

                    # Extract emoji title from the aria-label attribute
                    emoji_title = emoji.get("aria-label", "N/A")

                    # Extract aria-describedby attribute
                    aria_describedby = emoji.get("aria-describedby", "N/A")

                    # Extract emoji URL (if needed)
                    emoji_url = emoji.get("href", "N/A")

                    # Append to the data structure
                    emoji_data.append({
                        "Group": group_name,
                        "Subgroup": subgroup_title,
                        "Emoji": emoji_char,
                        "Title": emoji_title,
                        "DescribedBy": aria_describedby,
                        "URL": emoji_url,
                    })
        

            # Write the rows
            for row in emoji_data:
                writer.writerow(row)

print(f"Data successfully saved to {output_file}")
